public boolean equals(Object obj) {
  if (obj == null || !(obj instanceof Attribute)){
    return false;
  }

  Attribute<?> attribute = (Attribute<?>) obj;

  return valueClass.equals(attribute.valueClass) && id.equals(attribute.id);
}
